• กระจังหน้า • สปอยเลอร์ • Carplay Box (ชุดกล่องดู Youtube / Netflix / Google Map) เพียงแค่เสียบช่อง USB ก็ใช้งานได้ทันที !! •

ชุดแต่งนิด entertainment หน่อย..
เพิ่มความสุขให้กับมิตรรักนักแต่งครับผม

► Car Playbox : กล่องความบันเทิงรูปแบบใหม่ ที่ใช้งานง่ายเพียงรถของคุณมีระบบ Apple Car Play จากโรงงาน แค่เสียบช่อง USB ของรถก็ใช้งานได้ทันที

▶️ กล่องมีขนาดเล็กขนาดเท่าฝ่ามือ กระทัดรัด น้ำหนักเบาพกพาได้
▶️ ชุดกล่องเป็นแบบ Plug And Play ไม่มีการตัดต่อสายไฟภายในรถ หรือการแฮ็กระบบ ไม่มีปัญหาเรื่องวารันตี
▶️ มาพร้อมโปรแกรมความบันเทิง อาทิ Youtube / Netflix / ทีวีออนไลน์ / Google Map / Google Playstore / etc.
▶️ รองรับสำหรับรถรถยุโรป ที่มีระบบ Apple Car Play จากโรงงานไม่ว่าจะเป็น Benz / Audi / Volvo / Ford / BMW etc.
▶️ มีช่อง Port USB บนตัวกล่องรองรับไฟล์หนังจากแฟรชไดฟ์เพื่อความบันเทิงแบบเต็มขั้น
▶️ ระบบอินเตอร์เน็ตเพียงแค่ลูกค้า ใช้โทรศัพท์แชร์ Wifi Hotspot จากโทรศัพท์มือถือและเชื่อมต่อก็ใช้งานได้ทันที
▶️ ไม่ต้องเปลี่ยนหน้าจอเดิมของรถ ความละเอียดของภาพขึ้นอยู่กับจอของลูกค้า
▶️ รองรับกับจอทั้งแบบ Touch Screen และเป็นแบบปุ่ม Commander ของรถ และระบบต่างๆบนพวงมาลัยใช้งานตามปกติ
▶️ รองรับภาษาไทย และการพิมพ์ด้วยการพูดทั้งภาษาไทย / อังกฤษ เพื่อความสะดวกอีกขั้น

